.side-nav-v5 {
  position: fixed;
  top: 0;
  left: 0;
  z-index: 1040;
  width: 15rem;
  height: 100%;
  padding: 0;
  padding-bottom: 3.75rem;
  margin: 0;
  overflow: hidden;
  list-style-type: none;
  background-color: #fff;
  background-repeat: no-repeat;
  background-position: center;
  background-size: cover;
  box-shadow: 0 2px 5px 0 rgba(0, 0, 0, 0.16), 0 2px 10px 0 rgba(0, 0, 0, 0.12);
  transform: translateX(-100%);
  backface-visibility: hidden;
  will-change: transform
}

.side-nav-v5.wide-v5 {
  width: 15rem;
  transition-timing-function: linear, linear, ease;
  transition-duration: .5s, .5s, .55s;
  transition-property: top, bottom, width
}

.side-nav-v5.wide-v5 .logo-wrapper-v5.sn-ad-avatar-wrapper-v5 {
  height: 5rem;
  border-bottom: 1px solid rgba(153, 153, 153, 0.3);
  color: #555;
  display: block;
  margin-top: 20px;
}

.side-nav-v5.wide-v5 .logo-wrapper-v5.sn-ad-avatar-wrapper-v5 a {
  line-height: 2.6rem;
  color: #fff
}

.side-nav-v5.wide-v5 .logo-wrapper-v5.sn-ad-avatar-wrapper-v5 a span {
  padding-left: .7rem;
  margin-top: -1rem
}

.side-nav-v5.wide-v5 .logo-wrapper-v5.sn-ad-avatar-wrapper-v5 a img {
  max-width: 2.5rem;
  padding: 0;

}

.side-nav-v5.wide-v5 .collapsible-v5 a {
  transition: all .3s ease-in-out;
  align-items: center;
  display: flex;
  font-weight: 400
}

.side-nav-v5.wide-v5 .collapsible-v5 a .sv-normal-v5 {
  opacity: 1;
  transition: all .1s linear
}

.side-nav-v5.wide-v5 .collapsible-v5 a .sv-slim-v5 {
  display: none;
  opacity: 0;
  transition: all .1s linear
}

.side-nav-v5.wide-v5 .collapsible-v5 .sv-slim-icon-v5 {
  width: 30px;
  height: 36px;
  padding-left: 0;
  margin-right: 0;
  text-align: left
}

.side-nav-v5.wide-v5 .collapsible-body-v5 a {
  padding-left: 47px
}

.side-nav-v5.wide-v5 .fa-angle-down.rotate-icon {
  display: block;
  opacity: 1
}

.side-nav-v5.wide-v5.slim-v5 {
  right: 3.75rem;
  width: 3.75rem !important;
  transition-timing-function: linear, linear, ease;
  transition-duration: .5s, .5s, .55s;
  transition-property: top, bottom, width
}

.side-nav-v5.wide-v5.slim-v5 .collapsible-v5 a {
  margin-left: 9px;
  transition: all .3s ease-in-out
}

.side-nav-v5.wide-v5.slim-v5 .collapsible-v5 a .sv-normal-v5 {
  opacity: 0;
  transition: all .1s linear
}

.side-nav-v5.wide-v5.slim-v5 .collapsible-v5 a .sv-slim-v5 {
  display: block;
  opacity: 1;
  transition: all .1s linear
}

.side-nav-v5.wide-v5.slim-v5 .collapsible-v5 .sv-slim-icon-v5 {
  width: 30px;
  height: 36px;
  padding-left: 0;
  margin-right: 0;
  text-align: left
}

.side-nav-v5.wide-v5.slim-v5 .fa-angle-down.rotate-icon {
  display: none;
  opacity: 0
}

.side-nav-v5>ul {
  max-height: 100vh
}

.side-nav-v5 ul {
  padding-left: 0;
  list-style: none;
  list-style-type: none
}

.side-nav-v5 ul li {
  padding: 0
}

.side-nav-v5.right-aligned-v5 {
  right: 0;
  left: auto;
  transform: translateX(100%)
}

.side-nav-v5.side-nav-light-v5 .logo-wrapper-v5 {
  border-bottom: 1px solid rgba(153, 153, 153, 0.3)
}

.side-nav-v5.side-nav-light-v5 .logo-wrapper-v5.sn-ad-avatar-wrapper-v5 {
  color: #555;
  display: block;
  margin-top: 20px;
}

.side-nav-v5.side-nav-light-v5 .about {
  border-bottom: 1px solid rgba(153, 153, 153, 0.3)
}

.side-nav-v5.side-nav-light-v5 .about p {
  color: #555
}

.side-nav-v5.side-nav-light-v5 .social {
  border-bottom: 1px solid rgba(153, 153, 153, 0.3)
}

.side-nav-v5.side-nav-light-v5 .social .fas,
.side-nav-v5.side-nav-light-v5 .social .fab,
.side-nav-v5.side-nav-light-v5 .social .far {
  color: #555
}

.side-nav-v5.side-nav-light-v5 .search-form input[type="text"] {
  color: #555 !important;
  border-bottom-color: rgba(153, 153, 153, 0.3)
}

.side-nav-v5.side-nav-light-v5 .search-form input[type="text"]::placeholder {
  color: #555 !important
}

.side-nav-v5.side-nav-light-v5 .collapsible-v5 a {
  color: #555
}

.side-nav-v5.side-nav-light-v5 .collapsible-v5 li .collapsible-header-v5:hover {
  background-color: rgba(0, 0, 0, 0.05)
}

.side-nav-v5.side-nav-light-v5 .collapsible-v5 li .collapsible-header-v5.active {
  color: #4285f4;
  background-color: transparent
}

.side-nav-v5.fixed {
  position: fixed;
  left: 0;
  transform: translateX(0)
}

.side-nav-v5.fixed.right-aligned-v5 {
  right: 0;
  left: auto
}

@media only screen and (max-width: 1440px) {
  .side-nav-v5.fixed {
    transform: translateX(-105%)
  }

  .side-nav-v5.fixed.right-aligned-v5 {
    transform: translateX(105%)
  }
