}

.side-nav-v5 .collapsible-v5 li {
  line-height: 46px
}

.side-nav-v5 .collapsible-v5 a {
  height: 46px;
  font-size: .8rem;
  font-weight: 300;
  color: inherit
}

.side-nav-v5 .collapsible-v5 a:hover {
  border-radius: 2px;
  background-color: rgba(66, 133, 244, 0.05);
  color: #4285f4
}

.side-nav-v5 .collapsible-v5 .fas,
.side-nav-v5 .collapsible-v5 .fab,
.side-nav-v5 .collapsible-v5 .far {
  margin-right: 13px;
  font-size: .8rem
}

.side-nav-v5 .collapsible-v5 i {
  margin-right: 16px !important
}

.side-nav-v5 .collapsible-body-v5 a {
  height: 36px;
  padding-left: 47px;
  line-height: 36px
}

.side-nav-v5 a {
  display: block;
  line-height: 56px
}

.side-nav-v5 .fa-angle-down.rotate-icon {
  position: absolute;
  top: .8rem;
  right: 0;
  margin-right: 1.25rem
}

.side-nav-v5 .sidenav-bg-v5 {
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  z-index: -1;
  width: 15rem;
  background-attachment: fixed
}

.side-nav-v5 .sidenav-bg-v5:after {
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  z-index: -1;
  display: block;
  width: 100%;
  height: 100%;
  padding-bottom: 99999px;
  margin-bottom: -99999px;
  content: ""
}

.side-nav-v5 .logo-wrapper-v5 {
  height: 8.75rem;
  border-bottom: 1px solid rgba(153, 153, 153, 0.3);
  height: 100px
}

.side-nav-v5 .logo-wrapper-v5 a {
  width: 15rem;
  height: 8.75rem;
  padding: 0
}

.side-nav-v5 .logo-wrapper-v5 img {
  height: auto;
  margin: 0 auto;
  padding: 10px
}

@media (max-height: 992px) {
  .side-nav-v5 .logo-wrapper-v5 a {
    height: 80px
  }
}

.side-nav-v5 .logo-wrapper-v5.sn-avatar-wrapper {
  padding-top: 10%;
  padding-right: 33%;
  padding-bottom: 10%;
  padding-left: 33%
}

.side-nav-v5 .logo-wrapper-v5.sn-avatar-wrapper img {
  max-width: 90px;
  padding: 0;
  margin: 0;
  box-shadow: 0 2px 5px 0 rgba(0, 0, 0, 0.16), 0 2px 10px 0 rgba(0, 0, 0, 0.12)
}

@media only screen and (max-height: 992px) {
  .side-nav-v5 .logo-wrapper-v5.sn-avatar-wrapper {
    padding-right: 40%;
    padding-left: 40%
  }

  .side-nav-v5 .logo-wrapper-v5.sn-avatar-wrapper img {
    max-width: 50px
  }
}

.side-nav-v5 .logo-wrapper-v5.sn-ad-avatar-wrapper-v5 {
  height: auto;
  margin-bottom: 0
}

.side-nav-v5 .logo-wrapper-v5.sn-ad-avatar-wrapper-v5 img {
  float: left;
  max-width: 3.75rem;
  padding: 1.25rem 0.63rem
