}

.side-nav-v5 .about {
  padding: 1rem;
  border-bottom: 1px solid rgba(255, 255, 255, 0.65)
}

.side-nav-v5 .about p {
  margin-bottom: 0;
  text-align: center
}

.side-nav-v5 .social {
  padding-top: 0;
  text-align: center;
  border-bottom: 1px solid rgba(153, 153, 153, 0.3);
  padding: 10px 0
}

.side-nav-v5 .social li {
  display: inline-block;
  padding-top: .6rem;
  padding-bottom: .6rem;
  margin: 0
}

.side-nav-v5 .social a {
  padding: 0;
  margin: 0
}

.side-nav-v5 .social .fas,
.side-nav-v5 .social .fab,
.side-nav-v5 .social .far {
  padding-right: .6rem;
  padding-left: .6rem;
  font-size: .9rem;
  transition: .3s
}

.side-nav-v5 .social .fas:hover,
.side-nav-v5 .social .fab:hover,
.side-nav-v5 .social .far:hover {
  transition: .3s
}

.side-nav-v5 .search-form {
  padding: 0
}

.side-nav-v5 .search-form input[type="text"] {
  padding-left: 1.88rem;
  font-weight: 300;
  border-bottom: 1px solid rgba(255, 255, 255, 0.65)
}

.side-nav-v5 .search-form input[type="text"]::placeholder {
  color: #fff
}

.side-nav-v5 .search-form .form-control {
  margin-bottom: 0
}

.drag-target {
  position: fixed;
  top: 0;
  z-index: 998;
  width: 10px;
  height: 100%
}

#sidenav-overlay-v5 {
  position: fixed;
  top: 0;
  right: 0;
  left: 0;
  z-index: 997;
  height: 120vh;
  background-color: rgba(0, 0, 0, 0.5);
  will-change: opacity
}

.transform-fix-input {
  transform: translateX(0) !important
}

.sidenav-transition-body {
  transition-property: margin-left, margin-right;
  transition-duration: 0.3s;
  transition-timing-function: linear
}

.popover-enter {
  opacity: 0.01;
  transform: scale(0.9) translateY(50%)
}

.popover-enter-active {
  opacity: 1;
  transform: scale(1);
  transition: scale 400ms ease-out, opacity 400ms ease-in
}

.popover-enter-done {
  opacity: 1;
  transform: scale(1)
}

.popover-exit {
  opacity: 1;
  transform: scale(0.8);
  transition: all 400ms ease-out
}

.popover-exit-active {
  opacity: 0;
  transform: scale(0.8);
  transition: all 400ms ease-out
}

.side-slide-v5-enter,
.side-slide-v5-appear {
  opacity: 1;
  transform: translateX(-100%)
}

.side-slide-v5-enter-active,
.side-slide-v5-appear-active {
  opacity: 1;
  transform: translateX(0%);
  transition: transform 400ms ease-out, opacity 400ms ease-in
}

.side-slide-v5-enter-done {
  opacity: 1;
  transform: translateX(0)
}

.side-slide-v5-exit {
  opacity: 1;
  transform: translateX(0%);
  transition: all 400ms ease-out
}

.side-slide-v5-exit-active {
  opacity: 1;
  transform: translateX(-100%);
  transition: all 400ms ease-out
}

.right-side-slide-v5-enter,
.right-side-slide-v5-appear {
  opacity: 1;
  transform: translateX(100%)
}

.right-side-slide-v5-enter-active,
.right-side-slide-v5-appear-active {
  opacity: 1;
  transform: translateX(0%) !important;
  transition: transform 400ms ease-out, opacity 400ms ease-in
}

.right-side-slide-v5-enter-done {
  opacity: 1;
  transform: translateX(0%) !important
}

.right-side-slide-v5-exit {
  opacity: 1;
  transform: translateX(0%);
  transition: all 400ms ease-out
}

.right-side-slide-v5-exit-active {
  opacity: 1;
  transform: translateX(100%);
  transition: all 400ms ease-out
}

.side-nav-v5[data-animate="false"] {
  transform: translateX(0%)
}

.side-nav-v5.wide-v5 {
  transition-property: all;
  transition-duration: 400ms;
  transition-timing-function: ease-out
}

.side-nav-v5.wide-v5.slim-v5 {
  width: 3.75rem;
  transition-property: all;
  transition-duration: 400ms;
  transition-timing-function: ease-out;
  right: 3.75rem
}

.right-aligned-v5.side-nav-v5.wide-v5.slim-v5 {
  right: 0
}
